import React, { Component } from "react";

import LoadingPage from "./components/includes/loadingPage";
import Header from "./components/includes/header";
import { BrowserRouter, Route } from "react-router-dom";
import ToTop from "./components/includes/toTop";
import Title from "./components/sections/title_section";
import Welcome from "./components/sections/welcome_section";
import OurFoodMenu from "./components/sections/ourFoodMenu_section";
import SpecialFood from "./components/sections/specialFood_section";
import BookTable from "./components/sections/bookTable_section";
import News from "./components/sections/news_section";
import Footer from "./components/includes/footer";

class App extends Component {
  render() {
    return (
      <div className="font_family_body font_color_body body_size text-center">
        <LoadingPage />
        <BrowserRouter>
          <Header />

          <Route path="/About" component="pages/about" />
        </BrowserRouter>
        <ToTop />
        <Title />
        <Welcome />
        <OurFoodMenu />
        <SpecialFood />
        <BookTable />
        <News />
        <Footer />
      </div>
    );
  }
}

export default App;
